import axios from 'axios'
import {
  SET_DIVICE
} from '../actions/viewPort'
const state = {
  device: 'desktop',
}

const getters = {
  device: state => state.device
}
const mutations = {

  [SET_DIVICE]: (state, newDevice) => {
    state.device = newDevice.toString();
  },
}

const actions = {
  setDevice: (context, newDevice) => {
    if (typeof newDevice === 'string') {
      context.commit(SET_DIVICE, newDevice)
    }
  }
}

export default {
  state,
  getters,
  actions,
  mutations
}
